import React, { useEffect, useState } from 'react';
import { useAppDispatch, useAppSelector } from 'store/hooks/hooks';
import ToggleButton from '../ToggleButton/ToggleButton';


import styles from './WinnerTableHead.module.scss';

function WinnerTableHead() {
   const dispatch = useAppDispatch();
   const winnersList = useAppSelector( store => store.list.winnersList );
   const [ sortBy, setSortBy ] = useState<string | undefined>(undefined)
   const [ sortDirection, setSortDirection ] = useState<string | undefined>(undefined)

   useEffect(() => {
      if( sortBy && sortDirection) console.log('lave')

   }, [ sortBy, sortDirection ])
   

   return(
      <div className={ styles.winnerTableHead }>
         <ToggleButton  
            name="sortBy" 
            valueOne="By Wins" 
            valueTwo="By Time" 
            startValue={null} 
            onToggle={(newValue: string | null) => {
               if (newValue !== null) {
                  setSortBy(newValue);
               }
            }}
            uncheckedValue={null}
         />
         <ToggleButton  
            name="sortDirection" 
            valueOne="Increasing" 
            valueTwo="Decreasing" 
            startValue={null} 
            onToggle={(newValue: string | null) => {
               if (newValue !== null) {
                  setSortDirection(newValue);
               }
            }}
            uncheckedValue={null}
         />
      </div>
   )
}

export default WinnerTableHead;
